import React, { useContext } from 'react'
import { Context } from "../store/appContext";



const VerProyecto = () => {

  const {store, actions}=useContext(Context)

  

  return (
    <>
        <h1>VerProyecto</h1>
        <p>{store.nombre}</p>
        <button type="button" className="btn btn-danger" onClick={()=>{fetch("http://127.0.0.1:5000/api/proyectos")
            .then((resp) => resp.json())
            .then(response => console.log(response));}} >Ver proyecto</button>
    </>
  )
}

export default VerProyecto;
